webpackJsonp([0xaaddc181540f],{1273:function(t,e){t.exports={data:{site:{siteMetadata:{title:"Psyked: James' Web Development website",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/fast-and-fresh-loading-graphics-with-ajaxloadinfo/index.md absPath of file >>> MarkdownRemark",html:'<p>Here\'s a neat little site - <a href="http://www.ajaxload.info/" title="Open link in a new window">ajaxload</a>.  There\'s nothing better than letting your user know when they\'re waiting for something, and although a simple animation can\'t tell them the exact progress, or how much longer they\'ll have to wait - it\'s often the thought that counts.  Your preloader / loading animation is that little extra bit of finessé for your creations.</p>\n<p>And ajaxload has a lovely little generator to knock some graphics up for you, in a variety of formats and completely customizable colours.</p>\n<p><img src="/content/images/2007/10/ajax-loader3.gif"> <img src="/content/images/2007/10/ajax-loader4.gif"> <img src="/content/images/2007/10/ajax-loader.gif"></p>',frontmatter:{title:"Fast and fresh loading graphics with ajaxload.info",date:"October 21, 2007",tags:["design","external-links"],url:null,image:null,description:null}}},pathContext:{prev:{frontmatter:{path:"/blog/externalinterface-not-working-in-firefox/",tags:["actionscript","externalinterface","firefox"],title:"ExternalInterface not working in Firefox?",date:"2007-10-20T10:31:39.000Z",description:null,image:null}},next:{frontmatter:{path:"/blog/pseudo-ajax-loading-with-css/",tags:["css","ajax"],title:"Pseudo-AJAX loading with CSS",date:"2007-10-28T14:36:55.000Z",description:null,image:null}}}}}});
